import React from 'react';

const FieldsViewer=({label,type,handleChange})=>{
    return(
        <div>
           <label>{label}:</label>
           <input
                label={type}
                onChange={handleChange}>          
           </input>
        </div>
    );
        
    

}

export default FieldsViewer;
